import React from 'react';
import './App.css';
import { NavLink, Redirect } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <ul>
        <li><NavLink   path="/" activeClassName="active_class" exact component={() => {
          <Home name="about us" />
        }} > Home </NavLink></li>
        <li><NavLink path="/about" activeClassName="active_class" exact > About </NavLink></li>
        <li><NavLink path="/services" activeClassName="active_class" exact > Services </NavLink></li>
        <li><NavLink path="/contact" activeClassName="active_class" exact > Contact </NavLink></li>
        <Redirect path='/error'></Redirect>
      </ul>
    </div>
  );
}

export default App;
